import React from "react";
import Layout from "../components/layout/Layout";

const MainPage = () => {
  return (
    <Layout>
      <h1>메인 페이지</h1>
      <p>여기에 메인 콘텐츠가 들어갑니다.</p>
    </Layout>
  );
};

export default MainPage;
